import React from 'react';
import Header from '../Header';
function Feminino({ modelo }){
    return(
        <div>
            <ul>
                {modelo.filter((item)=>item === 'Feminino')
                    .map((item)=>item.nome)}
            </ul>

        </div>
    );
};

export default Feminino;
